import React, { Suspense, lazy } from 'react';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import { Provider } from 'react-redux';
import { store } from './components/redux/store';
import Loader from './components/Loader/Loader'; 

const Login = lazy(() => import("./Auth/Login"));
const SignUp = lazy(() => import("./Auth/SignUp"));
const NewExpense = lazy(() => import("./components/NewExpense/NewExpense"));
const NewExpenseItem = lazy(() => import("./components/Expenses/NewExpenseItem"));
const Logout = lazy(() => import('./Auth/Logout'));

function App() {
  return (
    <Provider store={store}>
      <BrowserRouter>
        <Suspense fallback={<Loader />}>  {/* Use Suspense and provide the loader as a fallback */}
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<SignUp />} />
            <Route path="/" element={
              <>
                <NewExpense />
                <Logout />
                <NewExpenseItem />
              </>
            } />
          </Routes>
        </Suspense>
      </BrowserRouter>
    </Provider>
  );
}

export default App;
